[The Daily Bleed Calendar in coagulation with nice dreams remembers in red...]

- OCTOBER 2

HAPPY OLD MAN'S DAY! (England) A 16th Century man's lucky escape from premature internment is still celebrated in Braughing, Herts. It's good to be alive. 

HAPPY FEAST OF GUARDIAN ANGELS! (Spain) Bonfire on steps of church, sword dancing, &amp; mock duel with constant interruptions from &quot;Devil Fool&quot; &amp; &quot;Boy Angel.&quot; Devil's tail explodes at finale. The girls' skirts are pinned up to reveal panties. Much music &amp; feasting.

- JUNE 28

&quot;I am the joy of the desiring flesh
The days of my living
are summer days
The nights of my glory
outshine the blazing wavecaps of the heavens
at their floodtide
Mine is the confident hand shaping this world.&quot;

 -- Kenneth Patchen

